import React from 'react';
import '../App.css';
import { motion } from "framer-motion";

const Hero = () => {
  return (
    <div className='hero-container'>
      <motion.div
        animate={{
          y: [1, -1, -1, 1]
      }}
        transition={{ type: "tween", repeat: Infinity, duration: 1.5}}>
        <h1>Pete Potipitak</h1>
        <p>All about Pete</p>
      </motion.div>
    </div>
  )
}

export default Hero
